import React from "react";
import styled from "styled-components";

const StyleGame = styled.div`
    background-color: #102027;
    width: 600px;
    height: 800px;
    margin: auto;
    margin-top: 100px;
`;

const Board = styled.div`
    background-color: #37474f;
    width: 600px;
    height: 100px;
    margin: auto;
`;

const Game = () => {
    return (
        <StyleGame>
            <Board></Board>
        </StyleGame>
    );
};

export default Game;
